"use client"; // Indicate that this component is a Client Component

import { SignIn, useAuth } from "@clerk/nextjs";
import { useRouter } from "next/navigation";
import { useEffect, useState } from "react";

export default function Page() {
  const { isSignedIn } = useAuth();
  const router = useRouter();
  const [currentParagraphIndex, setCurrentParagraphIndex] = useState(0);

  useEffect(() => {
    if (isSignedIn) {
      router.push("/dashboard");

    }

    const paragraphs = [
      "Master interviews with our AI-powered simulation for job seekers.",
      "Get valuable feedback to enhance your interviewing capabilities today.",
      "Join a community dedicated to improving their interview performance.",
      "Transform your approach to interviews and boost your confidence."
    ];

    const interval = setInterval(() => {
      setCurrentParagraphIndex((prevIndex) =>
        (prevIndex + 1) % paragraphs.length
      );
    }, 15000); // Change para in every 15s

    return () => clearInterval(interval); 
  }, [isSignedIn, router]);

  return (
    <section className="relative overflow-hidden bg-red"> {/* White background */}
      {/* Background squares */}
      <div className="absolute inset-0 -z-10 size-full bg-white bg-[linear-gradient(to_right,#f0f0f0_2px,transparent_2px),linear-gradient(to_bottom,#f0f0f0_2px,transparent_2px)] bg-[size:6rem_4rem]" />

      <div className="lg:grid lg:min-h-screen lg:grid-cols-12">
        <aside className="relative block h-16 lg:order-last lg:col-span-5 lg:h-full xl:col-span-6">
          <img
            alt="AI Robot"
            src="data:image/png;base64,"
            className="h-full w-full"
          />
        </aside>

        <main className="flex items-center justify-center px-8 py-8 sm:px-12 lg:col-span-7 lg:px-16 lg:py-12 xl:col-span-6">
        <div className="max-w-xl lg:max-w-3xl">
        <img src='./logo.svg' alt="Your Logo" className="h-8 sm:h-10" />
          <h1 className="mt-4 text-3xl font-bold text-red-900 sm:text-3xl md:text-5xl">
            Welcome to AI-Interviewer
          </h1>

            <p className="text-lg pb-6 mt-4 leading-relaxed text-red-900">
              {[
                "Master interviews with our AI-powered simulation for job seekers.",
                "Get valuable feedback to enhance your interviewing capabilities today.",
                "Join a community dedicated to improving their interview performance.",
                "Transform your approach to interviews and boost your confidence."
              ][currentParagraphIndex]}
            </p>
            <SignIn />
          </div>
        </main>
      </div>
    </section>
  );
}